class AsyncDeviceCheckerApp:
    def __init__(self, root):
        self.root = root
        self.icon_tempfile = None
        self.set_window_icon()
        self.root.title(" By Dean")
        self.root.geometry("1000x700")
        self.results = []
        self.only_show_abnormal = tk.BooleanVar(value=False)
        self.only_show_normal = tk.BooleanVar(value=False)
        self.progress_q = queue.Queue()
        self.done_q = queue.Queue()
        self.original_data = pd.DataFrame()
        self.btn_check = None
        self.all_rows = []
        self.total_for_progress = 0
        self.create_widgets()
        self.root.protocol("WM_DELETE_WINDOW", self.on_close)

    def on_close(self):
        """ ico """
        if self.icon_tempfile:
            try:
                os.remove(self.icon_tempfile)
            except Exception:
                pass
        self.root.destroy()

    def set_window_icon(self):
        """iconpyinstaller"""
        icon_file = "tonnet_icon.ico"
        if hasattr(sys, "_MEIPASS"):
            icon_path = os.path.join(sys._MEIPASS, icon_file)
        else:
            icon_path = icon_file
        try:
            self.root.iconbitmap(icon_path)
        except Exception as e:
            print("icon load error:", e)

    def create_widgets(self):
        frame = tk.Frame(self.root)
        frame.pack(pady=10)
        tk.Button(frame, text=" Excel", command=self.load_excel).pack(side=tk.LEFT, padx=5)
        self.btn_check = tk.Button(frame, text="", command=self.start_async_check_thread)
        self.btn_check.pack(side=tk.LEFT, padx=5)
        tk.Button(frame, text="", command=self.clear_data).pack(side=tk.LEFT, padx=5)
        tk.Button(frame, text="", command=self.export_results).pack(side=tk.LEFT, padx=5)

        cb1 = tk.Checkbutton(frame, text="", variable=self.only_show_abnormal,
                             command=self.check_abnormal_clicked)
        cb1.pack(side=tk.LEFT, padx=5)
        cb2 = tk.Checkbutton(frame, text="", variable=self.only_show_normal,
                             command=self.check_normal_clicked)
        cb2.pack(side=tk.LEFT, padx=5)

        self.status_label = tk.Label(self.root, text="", anchor="w")
        self.status_label.pack(fill=tk.X, padx=10)

        paned = ttk.PanedWindow(self.root, orient=tk.VERTICAL)
        paned.pack(fill=tk.BOTH, expand=True, padx=10, pady=5)

        # 
        top_frame = tk.Frame(paned)
        self.top_tree = ttk.Treeview(top_frame, columns=("index", "name", "ip"), show="headings", height=10)
        for col, text in zip(("index", "name", "ip"), ("index", "", "ip")):
            self.top_tree.heading(col, text=text)
            self.top_tree.column(col, width=150)
        vsb_top = ttk.Scrollbar(top_frame, orient="vertical", command=self.top_tree.yview)
        hsb_top = ttk.Scrollbar(top_frame, orient="horizontal", command=self.top_tree.xview)
        self.top_tree.configure(yscrollcommand=vsb_top.set, xscrollcommand=hsb_top.set)
        vsb_top.pack(side=tk.RIGHT, fill=tk.Y)
        hsb_top.pack(side=tk.BOTTOM, fill=tk.X)
        self.top_tree.pack(fill=tk.BOTH, expand=True)
        paned.add(top_frame)

        # 
        bottom_frame = tk.Frame(paned)
        columns = ["index", "name", "ip", "", "dev_name", "software", "dev_model", "dev_mac"]
        display_columns = ["index", "", "ip", "", "", "", "", "MAC"]
        self.tree = ttk.Treeview(bottom_frame, columns=columns, show="headings")
        for col, text in zip(columns, display_columns):
            self.tree.heading(col, text=text)
            self.tree.column(col, width=100)
        vsb_bot = ttk.Scrollbar(bottom_frame, orient="vertical", command=self.tree.yview)
        hsb_bot = ttk.Scrollbar(bottom_frame, orient="horizontal", command=self.tree.xview)
        self.tree.configure(yscrollcommand=vsb_bot.set, xscrollcommand=hsb_bot.set)
        vsb_bot.pack(side=tk.RIGHT, fill=tk.Y)
        hsb_bot.pack(side=tk.BOTTOM, fill=tk.X)
        self.tree.pack(fill=tk.BOTH, expand=True)
        paned.add(bottom_frame)

    def is_valid_ip(self, s, name=""):
        try:
            ipstr = str(s).strip()
            name = str(name).lower()
            for badword in ["mask", "", "gateway", "", "gw", "router", "default gateway"]:
                if badword in name:
                    return False
            ip = ipaddress.ip_address(ipstr)
            if ip.is_loopback or ip.is_unspecified or ip.is_multicast or ip.is_reserved or ip.is_link_local:
                return False
            if ipstr.startswith("255.") or ipstr in ("0.0.0.0", "255.255.255.255"):
                return False
            if ipstr in ("255.255.255.0", "255.255.0.0", "255.0.0.0"):
                return False
            if ipstr.split(".")[-1] == "1":
                # namegateway
                if name and any(x not in "0123456789.[] " for x in name):
                    pass
                else:
                    return False
            if not isinstance(ip, ipaddress.IPv4Address):
                return False
            return True
        except Exception:
            return False

    def find_ip_and_name_column(self, df):
        for i in range(1, len(df.columns)):
            sample = df.iloc[:, i]
            name_col = df.iloc[:, i - 1] if i > 0 else ""
            valid_count = 0
            for val, n in zip(sample, name_col):
                if self.is_valid_ip(val, name=n):
                    valid_count += 1
            if valid_count > 5:
                return df.iloc[:, [i - 1, i]].dropna()
        return pd.DataFrame()

    def load_excel(self):
        path = filedialog.askopenfilename(filetypes=[("Excel Files", "*.xlsx *.xls")])
        if not path:
            return
        xls = pd.ExcelFile(path)
        sheet = "" if "" in xls.sheet_names else xls.sheet_names[0]
        df_raw = pd.read_excel(path, sheet_name=sheet, header=None)
        df = self.find_ip_and_name_column(df_raw)
        if df.empty:
            messagebox.showerror("", "")
            return
        df.columns = ["name", "ip"]
        df = df[~df['name'].astype(str).str.replace(' ', '', regex=False).str.contains('')]
        df['ip'] = df['ip'].astype(str).str.strip()   # 
        df = df[[self.is_valid_ip(row["ip"], row["name"]) for _, row in df.iterrows()]]
        df = df.reset_index(drop=True)
        df.insert(0, "index", range(1, len(df)+1))
        self.original_data = df
        self.update_top_table()
        self.status_label.config(text=f" {len(df)} ")

    def update_top_table(self):
        self.top_tree.delete(*self.top_tree.get_children())
        for _, row in self.original_data.iterrows():
            self.top_tree.insert("", "end", values=(row["index"], row["name"], row["ip"]))

    def check_abnormal_clicked(self):
        if self.only_show_abnormal.get():
            self.only_show_normal.set(False)
        self.update_table()

    def check_normal_clicked(self):
        if self.only_show_normal.get():
            self.only_show_abnormal.set(False)
        self.update_table()

    def update_table(self):
        self.tree.delete(*self.tree.get_children())
        for r in sorted(self.results, key=lambda x: x["index"]):
            show = True
            if self.only_show_abnormal.get():
                show = r[""].startswith("") or r[""].startswith("")
            elif self.only_show_normal.get():
                show = r[""].startswith("")
            if show:
                self.tree.insert("", "end", values=tuple(r.values()))

    def clear_data(self):
        self.original_data = pd.DataFrame()
        self.results = []
        self.tree.delete(*self.tree.get_children())
        self.top_tree.delete(*self.top_tree.get_children())
        self.status_label.config(text="")

    def export_results(self):
        if not self.results:
            messagebox.showwarning("", "")
            return
        now = datetime.now().strftime("%Y%m%d_%H%M%S")
        default_filename = f"_{now}.xlsx"
        file = filedialog.asksaveasfilename(initialfile=default_filename, defaultextension=".xlsx",
                                            filetypes=[("Excel files", "*.xlsx")])
        if file:
            # 
            display_columns = ["index", "", "ip", "", "", "", "", "MAC"]
            df = pd.DataFrame(sorted(self.results, key=lambda x: x["index"]))
            df.columns = display_columns
            df.to_excel(file, index=False)

    def start_async_check_thread(self):
        if self.btn_check:
            self.btn_check.config(state=tk.DISABLED)
        self.progress_q.queue.clear()
        self.done_q.queue.clear()
        self.results = []
        self.tree.delete(*self.tree.get_children())
        # +IP
        self.all_rows = list(self.original_data.to_dict(orient="records")) + [{"index": 9999, "name": "IP", "ip": "192.168.200.254"}]
        self.total_for_progress = len(self.original_data)
        threading.Thread(target=self.run_async_check, daemon=True).start()
        self.root.after(100, self.refresh_progress)

    def refresh_progress(self):
        try:
            while True:
                cur, total = self.progress_q.get_nowait()
                percent = int(cur/total*100) if total > 0 else 0
                self.status_label.config(text=f"{cur}/{total} ({percent}%)")
        except queue.Empty:
            pass
        if not self.done_q.empty():
            count = self.done_q.get()
            self.status_label.config(text=f" {count} ")
            self.update_table()
            if self.btn_check:
                self.btn_check.config(state=tk.NORMAL)
            return
        self.root.after(100, self.refresh_progress)

    def run_async_check(self):
        asyncio.run(self.check_devices_async())

    async def check_devices_async(self):
        ip_set = set()
        mac_set = set()
        finished = 0
        sem = asyncio.Semaphore(50)  # 50

        async def sem_check(row):
            async with sem:
                return await self.check_single_device(session, row, ip_set, mac_set)

        async with aiohttp.ClientSession() as session:
            tasks = [sem_check(row) for row in self.all_rows]
            for coro in asyncio.as_completed(tasks):
                result = await coro
                if result['ip'] == '192.168.200.254' and result[''] == ' ':
                    continue
                finished += 1
                self.results.append(result)
                self.progress_q.put((finished, self.total_for_progress))
        self.done_q.put(len(self.results))

    async def check_single_device(self, session, row, ip_set, mac_set):
        index, name, ip = row["index"], row["name"], row["ip"]
        status = " "
        dev_name = software = dev_model = dev_mac = ""
        info = await self.fetch_device_info(session, ip)
        if info:
            dev_name = info.get("dev_name", "")
            software = info.get("software", "")
            dev_model = info.get("dev_model", "")
            dev_mac = info.get("dev_mac", "")
            issues = []
            if str(name).strip() != str(dev_name).strip(): issues.append("")
            if ip in ip_set: issues.append("IP ")
            if dev_mac in mac_set and dev_mac: issues.append("MAC ")
            status = " " if not issues else " " + "".join(issues)
        else:
            status = " "
        ip_set.add(ip)
        if dev_mac: mac_set.add(dev_mac)
        return {
            "index": index, "name": name, "ip": ip, "": status,
            "dev_name": dev_name, "software": software, "dev_model": dev_model, "dev_mac": dev_mac
        }

    async def fetch_device_info(self, session, ip):
        for port in [8080, 80, 3377]:
            try:
                async with session.get(f"http://{ip}:{port}/device/info", timeout=1) as r:
                    if r.status == 200 and r.headers.get("Content-Type", "").startswith("application/json"):
                        return await r.json()
            except:
                continue
        return None

